import React from 'react';
import '../styles/priceTable.css';

/**
 * Componente reutilizable para mostrar tabla de precios
 * @param {Object} props
 * @param {string} props.fechaActualizacion - Fecha de última actualización
 * @param {Object} props.precios - Objeto con precios { g93, g95, g97, diesel, kero }
 * @param {string} props.variant - 'primary' (azul) o 'secondary' (verde) para competencia
 */
const PriceTable = ({ fechaActualizacion, precios, variant = 'primary' }) => {
  return (
    <table className={`price-table price-table--${variant}`}>
      <thead>
        <tr>
          <th>Actualización</th>
          <th>G93</th>
          <th>G95</th>
          <th>G97</th>
          <th>Diesel</th>
          <th>Kero</th>
        </tr>
      </thead>
      <tbody>
        <tr>
          <td className="price-table__date">{fechaActualizacion}</td>
          <td>{precios.g93 || '-'}</td>
          <td>{precios.g95 || '-'}</td>
          <td>{precios.g97 || '-'}</td>
          <td>{precios.diesel || '-'}</td>
          <td>{precios.kero || '-'}</td>
        </tr>
      </tbody>
    </table>
  );
};

export default PriceTable;
